import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelope, faLinkedin, faGithub } from '@fortawesome/free-brands-svg-icons';

function Contact() {
  return (
    <section id="contact" className="bg-dark text-white py-5">
      <div className="container text-left">
        <h2 className="display-4 text-orange">Contact Me</h2>
        <p>Want to collaborate or just say hello? Reach out!</p>
      </div>
    </section>
  );
}

export default Contact;
